import React from 'react'

const FormEditUser = () => {

    const [mail, setMail] = useState('');
    const [contraseña, setContraseña] = useState('');
    const [confContraseña, setContactoMail] = useState('');
    const [contactoTel, setContactoTel] = useState('');
    const [rut, setRut] = useState('');
    const [direccion, setDireccion] = useState('');
    const [departamento, setDepartamento] = useState('');
    const [condicionContrato_DOC, setCondicionContrato_DOC] = useState('');
    const [constInscripcionDGI_DOC, setConstInscripcionDGI_DOC] = useState('');
    const [constInscripcionBPS_DOC, setConstInscripcionBPS_DOC] = useState('');
    const [certDGI_DOC, setDocumentoCertDGI_DOC] = useState('');
    const [certComunBPS_DOC, setCertComunBPS_DOC] = useState('');
    const [segAccidenteTrab_DOC, setSegAccidenteTrab_DOC] = useState('');
    const [planillaTrab_DOC, setPlanillaTrab_DOC] = useState('');
    const [certDGI_FECHAVENCIMIENTO, setCertDGI_FECHAVENCIMIENTO] = useState('');
    const [certComunBPS_FECHAVENCIMIENTO, setCertComunBPS_FECHAVENCIMIENTO] = useState('');
    const [segAccidenteTrab_FECHAVENCIMIENTO, setSegAccidenteTrab_FECHAVENCIMIENTO] = useState('');
    const [planillaTrab_FECHAEMISION, setPlanillaTrab_FECHAEMISION] = useState('');
    const [msg, setMsg] = useState('');
    const navigate = useNavigate();
    const { id } = useParams();
  return (
    <div>
    <h1 className="title" style={{color:"black"}}>Usuarios</h1>
    <h2 className="subtitle" style={{color:"black"}}> Editar usuario </h2>
    <div className="card is-shadowless has-background-light">
        <div className="card-content">
            <div className="content">
            <form action="">
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Email </label>
                    <div className="control">
                        <input type="text" className="input has-background-white has-text-black custom-input" required placeholder="Email"/>
                    </div>
                </div>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Contraseña </label>
                    <div className="control">
                        <input type="password" className="input has-background-white has-text-black custom-input" required placeholder="*****"/>
                    </div>
                </div>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Confirmar contraseña </label>
                    <div className="control">
                        <input type="password" className="input has-background-white has-text-black custom-input" style={{color:"black"}} required placeholder="*****"/>
                    </div>
                </div>
                <div className="field">
                    <label  className="label" style={{color:"black"}}> Rol </label>
                    <div className="control">
                       <div className="select is-fullwitdh ">
                        <select name="" id="">
                            <option value="1"> 1-Admin</option>
                            <option value="2"> 2-Usuario</option>
                        </select>
                        </div> 
                    </div>
                </div>
                <div className="field">
                    <div className="control">
                    <button className="button is-success" style={{ backgroundColor: "#183e6e", color: "white", marginRight: "10px" }}> Actualizar </button>
                    <button className="button is-success" style={{ backgroundColor: "#183e6e", color: "white" }}> Cancelar </button>
                    </div>         
                </div>
            </form>
            </div>
        </div>
    </div>
</div>
  )
}

export default FormEditUser
